import React from "react";
import "./logo.png";

function Home() {
  return (
    <div>
      <h1 class="text-center">A STEP ABOVE</h1>
      <img class="logo" src="https://i.ibb.co/nwpScGw/A-Step-above.png"></img>
    </div>
  );
}

export default Home;
